?\n","\n","Key Tasks\n","1. Determine the best way to share your findings?\n","2. Create effective data visualizations\n","3. Present your findings\n","4. Ensure your work is accessible"]},{"cell_type":"markdown","id":"773bf50b","metadata":{"papermill":{"duration":0.016847,"end_time":"2022-09-26T22:08:53.3899","exception":false,"start_time":"2022-09-26T22:08:53.373053","status":"completed"},"tags":[]},"source":["In order to analyze the data and spot trends within it, the appropriate R packages for creating visualizations were installed and loaded into the workspace."]},{"cell_type":"code","execution_count":9,"id":"74303e00","metadata":{"execution":{"iopub.execute_input":"2022-09-26T22:08:53.427362Z","iopub.status.busy":"2022-09-26T22:08:53.425858Z","iopub.status.idle":"2022-09-26T22:09:45.513857Z","shell.execute_reply":"2022-09-26T22:09:45.51101Z"},"papermill":{"duration":52.110786,"end_time":"2022-09-26T22:09:45.517641","exception":false,"start_time":"2022-09-26T22:08:53.406855","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]}],"source":["install.packages(\"ggplot2\")\n","install.packages(\"ggrepel\")\n","library(ggplot2)\n","library(ggrepel)"]},{"cell_type":"markdown","id":"d6552f0b","metadata":{"papermill":{"duration":0.028428,"end_time":"2022-09-26T22:09:45.575595","exception":false,"start_time":"2022-09-26T22:09:45.547167","status":"completed"},"tags":[]},"source":["Since we generated an aggregated data set for analysis, we can begin to explore the variables of interest to see if there are any interesting trends and relationships. First, we explore the trip_duration variable which was calculated based on the difference (in mins) between the starting and ending times of a single recorded trip. The total trip durations (in mins) for each of the recorded months were added up using a function from the lubridate package."]},{"cell_type":"code","execution_count":10,"id":"e11e09b4","metadata":{"execution":{"iopub.execute_input":"2022-09-26T22:09:45.704009Z","iopub.status.busy":"2022-09-26T22:09:45.698385Z","iopub.status.idle":"2022-09-26T22:09:47.166798Z","shell.execute_reply":"2022-09-26T22:09:47.162895Z"},"papermill":{"duration":1.558897,"end_time":"2022-09-26T22:09:47.177289","exception":false,"start_time":"2022-09-26T22:09:45.618392","status":"completed"},"tags":[]},"outputs":[],"source":["monthly_total_trip_duration <- complete_divvy_tripdata %>%\n","  group_by(month = lubridate::floor_date(started_at, \"month\")) %>%\n","  summarize(total_trip_duration = sum(trip_duration))\n","\n","view(monthly_total_trip_duration)"]},{"cell_type":"markdown","id":"b9993126","metadata":{"papermill":{"duration":0.021937,"end_time":"2022-09-26T22:09:47.229135","exception":false,"start_time":"2022-09-26T22:09:47.207198","status":"completed"},"tags":[]},"source":["From the resulting table, we notice that there is a greater total trip duration (in mins) in the summer months which becomes much lower during the winter season. We create a visualization of this to get a better understanding of just how drastic the change was. In order to do so, we appropriately convert the month variable from a date time data type to a date data type. Furthermore, we divide the total trip duration (in mins) by a million to get a better fit of values for the y-axis on the graph."]},{"cell_type":"code","execution_count":11,"id":"96bbbdaa","metadata":{"execution":{"iopub.execute_input":"2022-09-26T22:09:47.27405Z","iopub.status.busy":"2022-09-26T22:09:47.272264Z","iopub.status.idle":"2022-09-26T22:09:48.87991Z","shell.execute_reply":"2022-09-26T22:09:48.877265Z"},"papermill":{"duration":1.635403,"end_time":"2022-09-26T22:09:48.884481","exception":false,"start_time":"2022-09-26T22:09:47.249078","status":"completed"},"tags":[]},"outputs":[