ave been closely correlated to the outdoor weather conditions (i.e. more customers using the service when it is warm and sunny). To get a better understanding of the difference in the total trip duration between casual riders and annual members, we add an additional condition in the function to group by the member_casual variable."]},{"cell_type":"code","execution_count":12,"id":"a4bacb9e","metadata":{"execution":{"iopub.execute_input":"2022-09-26T22:09:49.023274Z","iopub.status.busy":"2022-09-26T22:09:49.021604Z","iopub.status.idle":"2022-09-26T22:09:50.150443Z","shell.execute_reply":"2022-09-26T22:09:50.148692Z"},"papermill":{"duration":1.167907,"end_time":"2022-09-26T22:09:50.153065","exception":false,"start_time":"2022-09-26T22:09:48.985158","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'month'. You can override using the\n","`.groups` argument.\n"]}],"source":["monthly_total_trip_duration <- complete_divvy_tripdata %>%\n","  group_by(month = lubridate::floor_date(started_at, \"month\"), member_casual) %>%\n","  summarize(total_trip_duration = sum(trip_duration))\n","\n","view(monthly_total_trip_duration)"]},{"cell_type":"markdown","id":"53ced036","metadata":{"papermill":{"duration":0.018069,"end_time":"2022-09-26T22:09:50.189076","exception":false,"start_time":"2022-09-26T22:09:50.171007","status":"completed"},"tags":[]},"source":["From the resulting table, we notice that the total trip duration for casual riders is much more variable than for annual members as there was less consistency seen throughout the year. We create a visualization of this to get a better understanding of just how different the trend is between casual riders and annual members. Again, we appropriately convert the month variable from a date time data type to a date data type and divide the total trip duration (in mins) by a million."]},{"cell_type":"code","execution_count":13,"id":"b4393e