,"output_type":"display_data"}],"source":["monthly_mean_trip_duration <- complete_divvy_tripdata %>%\n","  group_by(month = lubridate::floor_date(started_at, \"month\")) %>%\n","  summarize(mean_trip_duration = mean(trip_duration))\n","\n","view(monthly_mean_trip_duration)\n","\n","monthly_mean_trip_duration[1] <- as.Date(monthly_mean_trip_duration$month)\n","\n","ggplot(monthly_mean_trip_duration, aes(x=month, y=mean_trip_duration)) +\n","  geom_line() +\n","  geom_point() +\n","  scale_y_continuous(breaks = seq(14, 28, 2),\n","                     limits = c(14, 28)) +\n","  scale_x_date(date_breaks = \"1 month\", date_labels = \"%b-%y\") +\n","  theme(axis.text.x = element_text(angle = 90, vjust = 0.5)) +\n","  xlab(\"Month\") +\n","  ylab(\"Mean Trip Duration (mins)\") +\n","  labs(title = \"Mean Trip Duration by Month\", \n","       subtitle = \"Data from May 2021 - Apr 2022\",\n","       caption = \"Source: Divvy (https://ride.divvybikes.com/system-data)\")\n","\n","ggsave(\"figure_3.pdf\")"]},{"cell_type":"markdown","id":"5a8abf38","metadata":{"papermill":{"duration":0.079748,"end_time":"2022-09-26T22:09:53.209476","exception":false,"start_time":"2022-09-26T22:09:53.129728","status":"completed"},"tags":[]},"source":["From the data table and graph, there was nothing unordinary about it. The trend is in-line with what we found when looking at the total trip durations. Again, we add another condition to group the member_casual variable to see if there were any surprises there."]},{"cell_type":"code","execution_count":15,"id":"0ed78cdb","metadata":{"execution":{"iopub.execute_input":"2022-09-26T22:09:53.255925Z","iopub.status.busy":"2022-09-26T22:09:53.254323Z","iopub.status.idle":"2022-09-26T22:09:54.828765Z","shell.execute_reply":"2022-09-26T22:09:54.826955Z"},"papermill":{"duration":1.600962,"end_time":"2022-09-26T22:09:54.831804","exception":false,"start_time":"2022-09-26T22:09:53.230842","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_ty