22711,"end_time":"2022-09-26T22:09:54.924075","exception":false,"start_time":"2022-09-26T22:09:54.901364","status":"completed"},"tags":[]},"source":["To further investigate the divide between casual riders and annual members, we will now explore the count_of_day variable to see the distribution of riders throughout the week. "]},{"cell_type":"code","execution_count":16,"id":"675f9d17","metadata":{"execution":{"iopub.execute_input":"2022-09-26T22:09:54.973593Z","iopub.status.busy":"2022-09-26T22:09:54.972083Z","iopub.status.idle":"2022-09-26T22:09:56.429091Z","shell.execute_reply":"2022-09-26T22:09:56.42729Z"},"papermill":{"duration":1.484197,"end_time":"2022-09-26T22:09:56.431553","exception":false,"start_time":"2022-09-26T22:09:54.947356","status":"completed"},"tags":[]},"outputs":[],"source":["monthly_count_day_of_week <- complete_divvy_tripdata %>%\n","  group_by(month = lubridate::floor_date(started_at, \"month\"), member_casual) %>%\n","  count(day_of_week, month)\n","\n","monthly_count_day_of_week[1] <- as.Date(monthly_count_day_of_week$month)\n","\n","monthly_count_day_of_week[3] <- as.character(monthly_count_day_of_week$day_of_week)\n","\n","monthly_count_day_of_week[4] <- as.numeric(monthly_count_day_of_week$n)\n","\n","view(monthly_count_day_of_week)"]},{"cell_type":"markdown","id":"bf2c0e39","metadata":{"papermill":{"duration":0.023898,"end_time":"2022-09-26T22:09:56.478434","exception":false,"start_time":"2022-09-26T22:09:56.454536","status":"completed"},"tags":[]},"source":["In the above code, we converted the data types of our variables so that they work nicely when we end up creating a visualization of the data. As seen in the table, it is hard to clearly make out any trends that appear due to how the data is organized. From our analysis for far, it seems that the season has a big role in influencing ridership which is apparent in casual riders as seen from our graphs. Thus, we will direct our focus onto the months of May, June, and July, as they showed the biggest differences in total trip duration between casual riders and annual members. "]},{"cell_type":"code","execution_count":17,"id":"f3e622a2","metadata":{"execution":{"iopub.execute_input":"2022-09-26T22:09:56.528453Z","iopub.status.busy":"2022-09-26T22:09:56.526782Z","iopub.status.idle":"2022-09-26T22:09:58.362587Z","shell.execute_reply":"2022-09-26T22:09:58.360857Z"},"papermill":{"duration":1.864455,"end_time":"2022-09-26T22:09:58.366111","exception":false,"start_time":"2022-09-26T22:09:56.501656","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Saving 12.5 x 6.67 in image\n","\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZVxTbRQA8LONDcbobhBQRBQRBbHFVuzA7n7tbsVARbG7wW5RbFSwEUlFaVEQ\nkG42Vvf9sDFhIK3Def4/Ptw9997nnl0GHO5TJIIgACGEEEII/f3Ikg4AIYQQQgjVD0zsEEII\nIYSkBCZ2CCGEEEJSAhM7hBBCCCEpgYkdQgghhJCUwMQOIYQQQkhKYGKHEEIIISQlMLFDCCGE\nEJISmNghhBBCCEkJTOwQQgghhKQEJnYIIYQQQlICEzuEEEIIISmBiR1CCCGEkJTAxA4hhBBC\nSEpgYocQQgghJCUwsUMIIYQQkhKY2CGEEEIISQlM7BBCCCGEpAQmdgghhBBCUgITO4QQQggh\nKYGJHUIIIYSQlMDEDiGEEEJISmBihxBCCCEkJTCxQwghhBCSEpjYIYQQQghJCUzsEEIIIYSk\nBCZ2CCGEEEJSAhM7hBBCCCEpgYkdQgghhJCUwMQOIYQQQkhKYGKHEEIIISQlZGJiv0g6BoQQ\nQgghVA9IAKCrp2/Xtr2kI0EIIYQQQrX3/t0bGQCwbW1/yvOqpINBCCGEEEK1N2nsUOxjhxBC\nCCEkJTCxQwghhBCSEpjYIYQQQghJCUzsEEIIIYSkBCZ2CCGEEEJSAhM7hBBCCCEpgYkdQggh\nhJCUqFliV/TjkKYSqfyXloqseSO9voOGHr76jP+bIm0wEu91F7xrPW0rScdShedDjQWhmlvv\n+a0XYmZcrOBToUzR11JqaWMzZfb8u+8Tf2sA9YLgFZxY4dzGXEVXRUZfW2lOTHZNa/gznw3/\nWRaim3wutbD0Lt8hxqJdwQXs0rtudtIu+b5QY5jceo/qj33YEEIIVaJ+ntgRfHZuZkqg760N\n07p3GLWZQ9RLrRJG8AunTBgh+DqeUiDpcP4+BMFns/KTv4R5XzgwpYfxsNXnGnjSH76jx+oj\n176l5XL5PDYzv4j/y3gl+9loMr+HaNv7Q2bpXV7hP1+e+ZZXetflkpfyOjMa02V+Z4AIIYQk\npvaJHYkiU4JSujz2/vqxnlF1DqwBILjeXtcFX2UefpS8c0rZN44Efn4wKCRRIUEQLw5OGHvi\nkwQDq9JVz8+CDZqyw5yFS7qpyP3y0F99Nv4IlcbrFSjCn9wvnnGlgsq6mVEkevnhylfRNo8V\n/zy3WLBtOGjCn4gSIYSQJNQ+sXP0/paSxUnJ4qRkcZOSf1zct5RGFv4hf7fFtZ7Ca4gM+z0W\