), percentage/2, pos))\n","\n","blank_theme <- theme_minimal()+\n","  theme(\n","    axis.title.x = element_blank(),\n","    axis.title.y = element_blank(),\n","    axis.text =  element_blank(),\n","    panel.grid = element_blank(),\n","    panel.border = element_blank(),\n","    plot.background = element_rect(fill = \"#ebf2ff\"),\n","    axis.ticks = element_blank(),\n","    plot.title = element_text(size=14, face=\"bold\"),\n","  ) \n","\n","ggplot(x202105_count_day_of_week_casual, aes(x = \"\", y = percentage, fill = day_of_week)) +\n","  geom_col(width = 1, color = 1) +\n","  coord_polar(theta = \"y\") +\n","  scale_fill_brewer(palette = \"Pastel1\", labels = c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\")) +\n","  geom_label_repel(data = x202105_count_day_of_week_casual_1, aes(y = pos, label = paste0(round(percentage), \"% \", \"[\", n, \"]\")),\n","                   size = 4, nudge_x = 1, show.legend =  FALSE) +\n","  labs(x = \"\", y = \"\", title = \"Proportions by Day of the Week\",\n","       subtitle = \"May 2021 - Casual\",\n","       caption = \"Source: Divvy (https://ride.divvybikes.com/system-data)\", \n","       fill = \"\") +\n","  blank_theme\n","\n","ggsave(\"figure_5.pdf\")"]},{"cell_type":"markdown","id":"7e8fa67f","metadata":{"papermill":{"duration":0.025409,"end_time":"2022-09-26T22:09:58.417144","exception":false,"start_time":"2022-09-26T22:09:58.391735","status":"completed"},"tags":[]},"source":["We calculated the proportion of rides that occurred on each day of the week, as a percentage, for casual riders in the month of May. A pie chart was generated from this data to show the distribution. We can see that casual riders are using the bikeshare service a lot more on Saturdays and Sundays when compared to the rest of the week. "]},{"cell_type":"code","execution_count":18,"id":"c6ed32ff","metadata":{"execution":{"iopub.execute_input":"2022-09-26T22:09:58.472174Z","iopub.status.busy":"2022-09-26T2